import React from "react";
import ReactDOM from "react-dom";
import Friend from "./Friend.js";

function FriendList(props){
    return props.friends.map((friend, i) => {
        return (
            <div className="friend-container" key={friend.name + "-" + i}>
                <div>Name:</div><div>{friend.name}</div>
                <div>Age:</div><div>{friend.age}</div>

                <div className="pets-container">
                    {friend.pets.map((pet, i)=>{
                        return(
                            <div className="pet" key={pet.name + " " + i}>
                                 <div>{pet.name}</div>
                                 <div>{pet.breed}</div>
                            </div>
                        )
                    })}
                </div>
            </div>
        )
    })
}

export default FriendList
